import { Input } from "antd";

const TestSearch = () => {
  return (
    <>
      <Input.Search onChange={(e) => {
        console.log(e.target.value);
        return (
            <button>Test search</button>
        )
      }}/>
    </>
  );
};

export default TestSearch;
